  const {savedSearch, setSavedSearch}=useContext (SearchContext)


  //if (!savedSearch.results) {return <h3>Waiting... </h3>}

  return (<div>
     <h1>CONTENT</h1>
     <ul>
     {savedSearch.results.map((item,i)=>{
       return (<Card item={item} key={i}/>)})}
     </ul>
  </div>)
};

export default Content
